        headers: {
          authorization: `token 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`,
        },
      });
      const { repository } = await graphqlWithAuth(`
        {
          viewer {
            login
          }
        }
      `);
      console.log(repository);
    }

    getQl();
  },[]);

  return (
    <div className="App">
    </div>
  );
}

export default App;
